function ProjectCard() {
    return (
      <div className="p-6 rounded-3xl border border-gray-600 border-solid text-center">
        <div className="flex text-left flex-wrap flex-row gap-[2.5rem] justify-around">
          <img
            src="/images/project-1.png"
            alt="Project 1"
            className="rounded-[2rem] w-[90%] h-[90%]"
          />
        </div>
        <h2 className="font-[600] text-[1.75rem] mb-[2rem] m-[1rem]">
          Project One
        </h2>
        <div className="flex justify-center gap-[1rem]">
          <button
            className="font-[600] transition-all duration-300 ease-in p-[1rem] w-[9rem] rounded-[2rem] border border-solid border-[#ffffff] bg-white text-black hover:cursor-pointer hover:bg-black hover:text-white"
            onClick={() => {
              const url = "https://github.com/jrsussner18";
              const newWindow = window.open(
                url,
                "_blank",
                "noopener,noreferrer"
              );
              if (newWindow) newWindow.opener = null;
            }}
          >
            Github
          </button>
          <button
            class="btn btn-color-2 project-btn"
            onclick="location.href='https://github.com/'"
          >
            Live Demo
          </button>
        </div>
      </div>
    );
}

export default ProjectCard;
